import React, { useState } from 'react';
import styled, { createGlobalStyle } from "styled-components";


function Navbar() {
  const linkStyle = { padding: '3px'};

  const uStyle={marginLeft: 'auto',
    flexDirection: 'row',
    display: 'flex',
    paddingLeft: '0',
    marginBottom: '0',
    marginTop:'0',
    marginRight:'35px',
    listStyle: 'none'};

  const LiBlock= styled.div`
  list-style: none;
    a {
      position: relative;
      display: block;
      text-transform: uppercase;
      margin: 3px 0;
      padding: 15px 15px;
      text-decoration: none;
      color: rgb(65, 15, 15);
      font-family: sans-serif;
      font-size: 18px;
      font-weight: 600;
      transition: .5s;
      z-index: 1;
      &:before {
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        border-top: 2px solid #262626;
        border-bottom: 2px solid #262626;
        transform: scaleY(2);
        opacity: 0;
        transition: .3s;
      }
      &:after {
        content: '';
        position: absolute;
        top: 2px;
        left: 0;
        width: 100%;
        height: 100%;
        background-color: rgb(65, 15, 15);
        transform: scale(0);
        opacity: 0;
        transition: .3s;
        z-index: -1;
      }
      &:hover {
        color: #fff;
        &:before {
          transform: scaleY(1);
          opacity: 1;
        }
        &:after {
          transform: scaleY(1);
          opacity: 1;
        }}`





  return (
    <nav >
      <section
        style={{
          display: 'flex',
          fontFamily: 'helvetica',
          flexDirection: 'row',
          alignItems: 'center',
          justifyContent: 'center',
          flexWrap: 'wrap',
          marginBottom:'5px',

        }}
        >
          <ul style={{
                flexDirection: 'row',
                display: 'flex',
                paddingLeft: '15px',
                marginLeft: '15px',
                marginTop: '10px',
                marginBottom: '5px',
                listStyle: 'none'}}>
            <li>
              <span><img src={Logo} style={{height:'55px',weight:'100%'}} alt="Logo"/></span>
            </li>
          </ul>
          <ul style={uStyle}>
          <LiBlock>
            <div style={linkStyle}>
              <a  href="/">Home</a>
            </div>
          </LiBlock>
          <LiBlock>
            <div style={linkStyle}>
              <a  href="/Dashboard">Dashboard</a>
            </div>
          </LiBlock>  
          <LiBlock>
            <div style={linkStyle}>
              <a  href="/Login">Login</a>
            </div>
          </LiBlock>  
        </ul>  
      </section>
      <hr style={{height:'3px',border:'none',color:'rgb(65, 15, 15)',backgroundColor:'rgb(65, 15, 15)',}}></hr>
    </nav>
  );
}

  export default Navbar;
